//import logo from './logo.svg';
//import Button from './Button';
import './App.css';
import selfie from './selfie.jpeg';
import React, {Component} from 'react';
import Paragraph from './paragraph';

class App extends Component {

    constructor(props) {
      super(props);
      this.state = {
        currentTab: 'About me'
      }
    }

    handleAboutMe = () => {
      this.setState({currentTab: 'About me'});
      console.log(this.state.currentTab);
    }

    handleGit = () => {
      this.setState({currentTab: 'Github'});
      console.log(this.state.currentTab);
    }

    handleContactMe = () => {
      this.setState({currentTab: 'Contact me'});
      console.log(this.state.currentTab);
    }

    render () {
      return (
        <div className="App">
          <div className="headbar">

            {/*top left logo*/}
            <p className="headbar_element" id="name">Jack Yang</p>

            {/*button about me*/}
            <button className="headbar_element" id="about_me" onClick={this.handleAboutMe}>About me</button>
            <p className="headbar_element">|</p>

            {/*button contact me, shows my contact info*/}
            <button className="headbar_element" id="contact_me" onClick={this.handleContactMe}>Contact me</button>
            <p className="headbar_element">|</p>

            {/*button github, redirects user to my git acc*/}
            <button className="headbar_element" id="github" onClick={this.handleGit}>Github</button>



          </div>
          <div className="body_sec">
            <img className="picture" src={selfie} alt="Please imagine my face here"/>
            <span className="paragraph"><Paragraph topic={this.state.currentTab}/></span>
          </div>
        </div>
      );
    }
}

